import 'bootstrap/dist/css/bootstrap.min.css';
import { Container } from 'react-bootstrap';


import NavbarComp from './components/miNavbar'
import Footer from './components/Footer'
import Movies from './components/Movies'



function App() {
  return (
    <Container>
      <NavbarComp/>


      <Movies/>

      <Footer/>
   </Container>

  );
}

export default App;
